export const initialState = {
    term: null
}

export const actionTypes = {

}

export const Reducer = (state, action) => {
    switch (action.type) {
        case 'Add':
            return state;
            break;
        case 'Sub':
            return state;
            break;
        default:
            return state;
            break
    }
}
